import React from "react";
import '../App.css';
import './ProjectSection.css'

function ProjectSections(props) {
    return (
        <div className='project-card'>
            <div className="same-line">
                <h3 className>{ props.title }</h3>
                <h5>{ props.dates }</h5>
            </div>
            <p>{ props.body }</p>
        </div>
    );
}
export default ProjectSections;
